import React from 'react';
import './PaymentPage.scss';
import UserSidebar from '../../components/UserSidebar/UserSidebar'; // Import UserSidebar

const PaymentPage: React.FC = () => {
    return (
        <div className="payment-page-container">
            <div className="sidebar-container">
                <UserSidebar /> {/* UserSidebar po lewej stronie */}
            </div>
            <div className="content-container">
                <h2>Your Payment Options</h2>
                <div className="payment-options">
                    <div className="payment-option">
                        <h4>Credit Card</h4>
                        <p>Pay securely using your credit card.</p>
                        <button>Select</button>
                    </div>
                    <div className="payment-option">
                        <h4>PayPal</h4>
                        <p>Pay using your PayPal account.</p>
                        <button>Select</button>
                    </div>
                    <div className="payment-option">
                        <h4>Bank Transfer</h4>
                        <p>Transfer funds directly from your bank account.</p>
                        <button>Select</button>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default PaymentPage;
